description:
Có thê Em đang cần xử lý dòng tài chính cần bán gấp lô đất ngay vòng xoay Bến Cam ở Nhơn Trạch (chỗ cao tốc đi xuống 
Diện tích khoảng gần 1200m2 (ngang khoảng 29m dài khoảng 37m nở hậu; đất góc 2 mặt tiền) đường trước đất xe khách đi thoải mái; từ Lô Đất ra mặt tiền đường TRẦN PHÚ (LỘ GIỚI 80m) khoảng 100m; 
- tiện làm căn hộ dịch vụ cho thuê, hoặc quán xá, nhà xưởng. 
- trước em mua tính làm building căn hộ dịch vụ vì khu này xin được GPXD hầm 6 tầng;
